import React from 'react';
import classes from "./OrderList.module.css";
import OrderPlate from "../OrderPlate/OrderPlate";
import {useNavigate} from 'react-router-dom'
import Loader from "../../Loader/Loader";
import ClientPlate from "../../Client Components/ClientPlate/ClientPlate";

const OrderList = ({Orders, isLoading}) => {
    const router = useNavigate();
    return (
        isLoading
            ?<Loader/>
            :Orders.length === 0
                ?
            <label>No Orders</label>
                :
            <table className={classes.clients}>
                <thead>
                <tr>
                    <th>Last name</th>
                    <th>First name</th>
                    <th>Patronymic</th>
                    <th>Email</th>
                    <th>Phone number</th>
                    <th>Date</th>
                </tr>
                </thead>
                <tbody>
                {Orders.map((ht)=>
                    <OrderPlate key={ht._id} item={ht}/>
                )}
                </tbody>
            </table>

    );
};

export default OrderList;
